import React, {FC} from 'react';
import './styles.scss';

interface IProps {};

export const RegistrationSuccesful: FC<IProps> = () => (
<div>
  <h1>Congratulations!! your registration was succesful.</h1>
  <p>Welcome to TransportWise.</p>
  <br />
  <button type="submit" className="btn">Register</button>
</div>
);

export default RegistrationSuccesful;
